import React from 'react';
import { Nav } from 'react-bootstrap';
import { Navbar } from 'react-bootstrap';
import { NavDropdown } from 'react-bootstrap';
import { ThemeSwitch } from './ThemeSwitch.js';
import { Image } from 'react-bootstrap';
import logo from './logo.png';

export class Header extends React.Component {
    // constructor(props) {
    //   super(props);
    //   this.state = {
    //     value: null,
    //   };
    // }

    render() {
      return (
        <Navbar bg="light" expand="lg">
          <Navbar.Brand href="#home">
          <Image src={logo} style={{height:'50px',width:'50px'}} rounded/>
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <NavDropdown
                title="Sleep Test"
                id="basic-nav-dropdown"
                components={{ DropdownIndicator:() => null }}
                >
                <NavDropdown.Item href="#action/3.1">Sleep score</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Sleep form</NavDropdown.Item>
              </NavDropdown>
              <Nav.Link href="#setting">Setting</Nav.Link>
              <Nav.Link href="#help">Help</Nav.Link>
              <Nav.Link href="#link">Profile</Nav.Link>
            </Nav>
            <Nav>
              <Nav.Link href="#deets">
                <ThemeSwitch></ThemeSwitch>
              </Nav.Link>
              <NavDropdown
                title="Sleep Test"
                id="basic-nav-dropdown"
                components={{ DropdownIndicator:() => null }}
                >
                <button class="nav-link btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                    <i class="fa fa-cog"></i>
                </button>
                <NavDropdown.Item href="#action/3.1">Sleep score</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Sleep form</NavDropdown.Item>
              </NavDropdown>
              <li class="nav-item dropdown">

                <div class="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
                  <a class="dropdown-item display-inline" href="#">Language<a href="#">TH</a>/<a href="#">EN</a></a>
                  <a class="dropdown-item" href="#">Voice Recorde</a>
                  <a class="dropdown-item" href="#">Logout</a>
                </div>
              </li>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      );
    }
  }
